INSERT INTO comments (Id, PostId, Score, Text, CreationDate, UserId, UserDisplayName) VALUES (87189, 44924, 1, 'Welcome to the site, @Shyam. I have added the ''homework'' tag, because your Q looks like it is. If it''s not, you can edit your Q to remove the tag w/ my apologies. Note that homework gets special treatment here: we provide hints to help you work through the problem, instead of a full solution, so that you can learn from the process (see our [FAQ](http://stats.stackexchange.com/faq)).', '2012-12-02 16:55:18.0', 7290, NULL);
INSERT INTO comments (Id, PostId, Score, Text, CreationDate, UserId, UserDisplayName) VALUES (219739, 114514, 0, 'not sure I understand. entropy is usually an issue in building an individual tree. covered extensively in Elements of Statistical Learning or Introduction to Statistical Learning. Both available in online pdf format.', '2014-09-06 19:53:46.0', 34658, NULL);

INSERT INTO postHistory (Id, PostHistoryTypeId, PostId, RevisionGUID, CreationDate, UserId, Text, Comment, UserDisplayName) VALUES (158699, 2, 49927, 'b2ba916a-8629-48bc-ba41-876ce344ad5f', '2013-02-13 18:41:30.0', 20812, 'How can binary explanatory variable be described in small words. A simple definition of what it is?', '', '');
INSERT INTO postHistory (Id, PostHistoryTypeId, PostId, RevisionGUID, CreationDate, UserId, Text, Comment, UserDisplayName) VALUES (120613, 5, 37829, 'e615eee4-59e0-4329-b008-f15247bbd132', '2012-09-23 18:46:58.0', 8462, 'In the [Wikipedia entry][1] on the multivariate normal distribution, it says that one definition \\n\\n> is that a random vector is said to be *k*-variate normally distributed\\n> if every linear combination of its *k* components has a univariate\\n> normal distribution.\\n\\nHowever, since it''s also true that any linear combination of normally distributed variables is itself normal, does this mean that any vector of univariate random normals is itself multivariate normal?  Is there ever any situation where a vector of random normals is **not** multivariate normal?\\n\\nUpdate\\n------\\nWhat I should have said was "any linear combination of **independent** normally distributed variables is itself normal."  All the answers below are good examples of variables that are not independent and thus not multivariate normal.  So I should rephrase my question to be:  is there ever any situation where a vector of **independent** random normals is **not** multivariate normal?  I''m leaving the headline as is, to reflect history and the nature of the answers to this question, but I will alter it if you think I should.  Sorry for any confusion I may have caused.\\n  \\n  [1]: http://en.wikipedia.org/wiki/Multivariate_normal_distribution', 'added 595 characters in body', '');
INSERT INTO postHistory (Id, PostHistoryTypeId, PostId, RevisionGUID, CreationDate, UserId, Text, Comment, UserDisplayName) VALUES (74299, 4, 24181, 'a27e5e97-e8c0-428f-a509-fffad8424dab', '2012-03-06 03:56:18.0', 2116, 'Coding the regresssion model with several binary variables', 'added 10 characters in body; edited title', '');

