<p>Although, it looks pretty obvious physically, I was interested to know if it could be proved mathematically.</p>
','
',char(10)), 4966, '2011-08-21 14:38:40.0', 'How does one prove that a separating hyper-plane exists for a linearly separable pattern?', '<self-study><classification>', 0, 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO posts (Id, PostTypeId, AcceptedAnswerId, CreaionDate, Score, ViewCount, Body, OwnerUserId, LasActivityDate, Title, Tags, AnswerCount, CommentCount, FavoriteCount, LastEditorUserId, LastEditDate, CommunityOwnedDate, ParentId, ClosedDate, OwnerDisplayName, LastEditorDisplayName) VALUES (56481, 1, NULL, '2013-04-18 14:57:38.0', 0, 195, replace('<p>I have data regarding the number of deaths in a city over 35 years. I''ve collated the data, and now wish to prove the difference in total number of deaths between seasons is significant. Spring has 631 deaths, summer 540 deaths, autumn 502 deaths and winter has 605 deaths. Clearly there is a big difference between spring and autumn, but how do I prove that? Is it ANOVA? Or maybe t-test? I''m totally lost... Cheers</p>
','
',char(10)), 24511, '2013-04-19 18:37:44.0', 'How to prove statistical significance between the 4 seasons', '<time-series><anova>', 4, 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
